        User current;
        while(fread(&current, sizeof(User), 1, file)) {
            if(strcmp(current.username, username) == 0 && 
               strcmp(current.password, password) == 0) {
                fclose(file);
                return 1;
            }
        }
        fclose(file);
    }
    return 0;
}

int main() {
    int choice;
    do {
        printf("1. Register\n2. Login\n3. Exit\nChoice: ");
        scanf("%d", &choice);
        getchar(); // Consume newline

        switch(choice) {
            case 1:
                register_user();
                break;
            case 2:
                if(login_user()) {
                    printf("Login successful!\n");
                } else {
                    printf("Invalid credentials\n");
                }
                break;
            case 3:
                printf("Exiting...\n");
                break;
            default:
                printf("Invalid choice\n");
        }
    } while(choice != 3);

    return 0;
}"}

